import "./App.css"
import FormInput from "./components/FormInputs";

const App = () => {
    return <div className="app">
        <form>
            <FormInput placeholder="Aadhar number"/>
            <FormInput placeholder="Blood group"/>
            <FormInput placeholder="Pulse rate"/>
            <FormInput placeholder="Oxygen Level"/>
            <FormInput placeholder="Temperature"/>
            <FormInput placeholder="Disease/Medical Condition"/>
            <FormInput placeholder="Pincode"/>
        </form>
    </div>
};

export default App;
